public boolean equals(Object o) {
  if (this == o) return true;
  if (o == null || getClass() != o.getClass()) return false;

  TermVectorEntry that = (TermVectorEntry) o;

  if (term != null ? !term.equals(that.term) : that.term != null) return false;

  return true;
}

